export const MyCard = styled(Card)({
  width: "445px",
  height: "350px",
  margin: "20px",
});

export const MyTypography = styled("span")({
  display: "inline-block",
  overflow: "auto",
  height: "50px",
  fontSize:"12px",
  margin: "0px"
});

export const MyButton = styled(Button)({
  textTransform: 'capitalize',
})
